from PIL import Image
import math
def sigmoid(x):
    if x >100:
        return 1
    if x < -100:
        return 0
    return 1.0/(1.0+ math.pow(math.e,-x))

def compute(thisSample,level1,level2,w0h,w0o,nhidden):
    oh = []
    oo = [0.0,0.0,0.0,0.0]
    for i in range(0,nhidden):
        oh.append(0.0)
    for i in range(0,nhidden):
        summ = 0
        for j in range(0,960):
            summ += level1[j][i]*thisSample[j]
        summ += w0h[i]
        oh[i] = sigmoid(summ)

    for i in range(0,4):
        summ = 0
        for j in range(0,nhidden):
            summ += level2[j][i]*oh[j]
        summ += w0o[i]
        oo[i] = sigmoid(summ)
    maxIndex = 0
    for index in range(0,4):
        if oo[index] == max(oo):
            maxIndex = index
    if maxIndex == 0:
        return "r"
    elif maxIndex == 1:
        return "s"
    elif maxIndex == 2:
        return "l"
    elif maxIndex == 3:
        return "u"



